import { Link } from "react-router-dom";
import React, { Component } from "react";

export class TransportuesiRegister extends Component {
    constructor(props) {
        super(props);
        this.handleSubmit = this.handleSubmit.bind();
    }

    addTransportuesi(){
        console.log("hello")
    }

    handleSubmit(event) {
        fetch(process.env.REACT_APP_API + 'perdoruesi', {
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({
                email: event.target.email.value,
                emri: event.target.emri.value + " " + event.target.mbiemri.value,
                password: event.target.password.value,
                qyteti: "PrishtinÃ«",
                adresa: event.target.adresa.value,
                nr_telefonit: event.target.nr_telefonit.value,
                photoProfile: "C:\\fakepath\\use-case-diag.jpg",
                roliID: 2

            })
        })
            .then(res => res.json())
            .then((result) => {
                alert(result);
            },
                (error) => {
                    alert('Failed');
                })
    }
    render() {
        return (
            <div className="d-flex justify-content-center align-content-center">

                <form class="row g-3 d-flex w-50 mt-4 mb-3" onSubmit={this.handleSubmit}>
                    <nav class="navbar bg-light">
                        <button class="btn btn-sm btn-outline-secondary" type="button"><Link to="/klientiregister" >Klient</Link></button>
                        <button class="btn btn-sm btn-outline-secondary" type="button"><Link to="/restorantiregister" >Restorant</Link></button>
                        <button class="btn btn-sm btn-outline-secondary" type="button"><Link to="/transportuesiregister" >Transportues</Link></button>
                    </nav>
                    <h1>Regjistrohu Si Transportues!</h1>
                    <div class="col-sm-12 align-self">
                        <label for="inputEmail4" class="form-label">Email</label>
                        <input type="email" class="form-control" id="inputEmail4" name="email" />
                    </div>
                    <div class="col-sm-12">
                        <label for="inputPassword4" class="form-label">Password</label>
                        <input type="password" class="form-control" id="inputPassword4" name="password" />
                    </div>
                    <div class="col-sm-12">
                        <label for="emri" class="form-label">Emri</label>
                        <input type="text" class="form-control" id="emri" name="emri" />
                    </div>
                    <div class="col-sm-12">
                        <label for="mbiemri" class="form-label">Mbiemri</label>
                        <input type="text" class="form-control" id="mbiemri" name="mbiemri" />
                    </div>
                    <div class="col-sm-12">
                        <label for="inputState" class="form-label">Qyteti</label>
                        <select id="inputState" class="form-select">
                            <option selected>Choose...</option>
                            <option>...</option>
                        </select>
                    </div>
                    <div class="col-sm-12">
                        <label for="adresa" class="form-label">Adresa</label>
                        <input type="text" class="form-control" id="adresa" name="adresa" />
                    </div>
                    <div class="col-sm-12">
                        <label for="nr_telefonit" class="form-label">Nr. Telefonit</label>
                        <input type="text" class="form-control" id="nr_telefonit" />
                    </div>
                    <div class="col-sm-12">
                        <label for="data_lindjes">Data Lindjes</label>
                        <input id="data_lindjes" class="form-control" type="date" name="data_lindjes" />
                    </div>
                    <div class="col-sm-12">
                        <label for="foto" class="form-label">Foto Profilit</label>
                        <input type="file" class="form-control" id="foto" name="foto_profilit" />
                    </div>

                    <div class="col-12">
                        <button type="submit" class="btn btn-primary">Regjistrohu</button>
                    </div>
                </form>
            </div>
        );
    }
}
